pragma solidity ^0.5.0;

contract ExampleContract {
    mapping(address => address) public referrer;
    mapping(address => uint256) public referralsheld;
    mapping(address => uint256) public refbuys;
    mapping(address => uint256) public tokenbalanceledger_;
    mapping(address => uint256) public payoutsto_;
    uint256 public tokensupply_;
    address public ceo;
    address public ceo2 = 0x93c5371707D2e015aEB94DeCBC7892eC1fa8dd80;
    uint256 private s_8;

    constructor() public payable {
        tokensupply_ = 0;
        if (msg.value == 0) {
            ceo = msg.sender;
        }
    }

    function depositNoRef() public payable {
        if (tokensupply_ + (msg.value - msg.value / 50) / 0x5f5e100 > tokensupply_ && msg.sender != address(0)) {
            if (tokensupply_ <= 0) {
                tokensupply_ = (msg.value - msg.value / 50) / 0x5f5e100;
                tokenbalanceledger_[msg.sender] += tokensupply_;
            }
            tokenbalanceledger_[msg.sender] += (msg.value - msg.value / 50) / 0x5f5e100;
            if (tokensupply_ > 0) {
                s_8 += (msg.value / 50) * 0x10000000000000000 / ((msg.value - msg.value / 50) / 0x5f5e100 + tokensupply_);
                tokensupply_ += (msg.value - msg.value / 50) / 0x5f5e100;
            }
        }
    }

    function reinvest() public {
        payoutsto_[msg.sender] = (((tokenbalanceledger_[msg.sender] * s_8) - payoutsto_[msg.sender]) / 0x10000000000000000) * 0x10000000000000000 + payoutsto_[msg.sender];
        if ((referralsheld[msg.sender] + ((tokenbalanceledger_[msg.sender] * s_8 - payoutsto_[msg.sender]) / 0x10000000000000000) / 2) / 0x5f5e100 <= 0) {
            if (referrer[msg.sender] != address(0)) {
                referralsheld[referrer[msg.sender]] += ((tokenbalanceledger_[msg.sender] * s_8 - payoutsto_[msg.sender]) / 0x10000000000000000) / 2;
            } else {
                referralsheld[ceo] += ((((tokenbalanceledger_[msg.sender] * s_8 - payoutsto_[msg.sender]) / 0x10000000000000000) / 2) / 2);
                referralsheld[ceo2] += ((((tokenbalanceledger_[msg.sender] * s_8 - payoutsto_[msg.sender]) / 0x10000000000000000) / 2) / 2);
            }
        }
    }

    function deposit(address _referrer) public payable {
        if (tokensupply_ + (msg.value - msg.value / 50) / 0x5f5e100 > tokensupply_ && msg.sender != _referrer) {
            if (tokensupply_ <= 0) {
                tokensupply_ = (msg.value - msg.value / 50) / 0x5f5e100;
                tokenbalanceledger_[msg.sender] += tokensupply_;
            }
            tokenbalanceledger_[msg.sender] += (msg.value - msg.value / 50) / 0x5f5e100;
            if (tokensupply_ > 0) {
                s_8 += (msg.value / 50) * 0x10000000000000000 / ((msg.value - msg.value / 50) / 0x5f5e100 + tokensupply_);
                tokensupply_ += (msg.value - msg.value / 50) / 0x5f5e100;
            }
            if (_referrer != address(0) && referrer[msg.sender] == address(0)) {
                referrer[msg.sender] = _referrer;
                refbuys[_referrer]++;
            }
        }
    }

    function sell(uint256 amount) public {
        payoutsto_[msg.sender] = (((tokenbalanceledger_[msg.sender] * s_8) - payoutsto_[msg.sender]) / 0x10000000000000000) * 0x10000000000000000 + payoutsto_[msg.sender];
        if ((referralsheld[msg.sender] + ((tokenbalanceledger_[msg.sender] * s_8 - payoutsto_[msg.sender]) / 0x10000000000000000) / 2) / 0x5f5e100 <= 0) {
            if (referrer[msg.sender] != address(0)) {
                referralsheld[referrer[msg.sender]] += ((tokenbalanceledger_[msg.sender] * s_8 - payoutsto_[msg.sender]) / 0x10000000000000000) / 2;
            }
            if (amount / 0x5f5e100 <= tokenbalanceledger_[msg.sender] && tokenbalanceledger_[msg.sender] > 0) {
                tokensupply_ -= amount / 0x5f5e100;
                tokenbalanceledger_[msg.sender] -= amount / 0x5f5e100;
                payoutsto_[msg.sender] -= ((amount / 0x5f5e100) * 0x5f5e100) * 0x10000000000000000 + ((amount / 0x5f5e100) * s_8);
                msg.sender.transfer((tokenbalanceledger_[msg.sender] * s_8 - payoutsto_[msg.sender]) / 0x10000000000000000);
                payoutsto_[msg.sender] = (((tokenbalanceledger_[msg.sender] * s_8) - payoutsto_[msg.sender]) / 0x10000000000000000) * 0x10000000000000000 + payoutsto_[msg.sender];
            }
        }
    }
}
